When you define a flatten transformation, you set the action attribute to flatten Transformation and specify the parameters.

The following table describes the input parameters:

PARAMETER	REQUIRED?	VALUE
include_self_id	No	Indicates whether to include the self ID node in the generated multi_field and path_field columns. Valid values are false (default) and true.
self_field	Yes	Name of the input field that identifies each node in the hierarchy.
parent_field	Yes	Name of the input field that identifies the direct parent of each node in the hierarchy.
multi_field	Yes	
Name of the multivalue output field that contains a list of all ancestors in the hierarchy, in order from the lowest to the highest level.
path_field	Yes	A string representation of the multi-field field, separated by backslashes. This output field contains the hierarchical path of all ancestors in the hierarchy, in order from the lowest to the highest level.
source	Yes	Node in the dataflow definition file that contains the hierarchical data that you want to flatten.

NOTE By default, the multi_field and path_field fields are created as system fields, which arenâ€™t visible in the user interface. To make the fields appear in the user interface, add a schema section to the flatten Transformation and set the IsSystemField metadata attribute to false for each field in the transformation.

"Flatten_UserRole": {
    "schema": {
      "objects": [
        {
          "label": "UserWithRoles",
          "fields": [
            {
              "name": "Roles",
              "label": "Roles",
              "isSystemField": false
            },
            {
              "name": "RolePath",
              "label": "RolePath",
              "isSystemField": false
            }
          ]
        }
      ]
    },
    "action": "flatten",
    "parameters": {
      "source": "Extract_UserRole",
      "self_field": "Id",
      "parent_field": "ParentRoleId",
      "multi_field": "Roles",
      "path_field": "RolePath",
      "include_self_id": false
    }
  }
